__NUXT_JSONP__("/drugs/Onvatilimab", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1969313-51-6",chebiId:b,chemicalFormula:b,definition:"A human monoclonal antibody against the protein V-domain immunoglobulin (Ig) suppressor of T-cell activation (VISTA; programmed death 1 homolog; PD1H; PD-1H), with potential negative checkpoint regulatory and antineoplastic activities. Upon administration, onvatilimab targets and binds to VISTA. This inhibits VISTA signaling, abrogates the VISTA-induced suppression of T-lymphocyte-mediated immune responses, enhances cytotoxic T-cell responses against tumor cells and inhibits tumor cell growth. VISTA, mainly expressed on hematopoietic cells, plays a key role in immunosuppression.",fdaUniiCode:"1UI8F5IIZ4",identifier:"C127124",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C129822","C20401"],synonyms:["Immunoglobulin G1, Anti-(Human Protein Vista (v-domain Immunoglobulin Suppressor of T Cell Activation)) (Human Clone JNJ 61610588 gamma1-chain), Disulfide with Human Clone JNJ","JNJ 61610588","JNJ-61610588","ONVATILIMAB",a,"WHO 10758"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FOnvatilimab",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Onvatilimab","","2021-10-30T13:30:56.583Z")));